import React from 'react';
import '../css/App.css';

const Dashboard = ({ playerData }) => (
  <div className="dashboard-container">
    {playerData ? (
      // Render navigation content when playerData is available
      <>
        <div className="overview-bar">
          <p> Overview | Main Champion Stats</p>
        </div>

        <div className="dashboard-bar" dangerouslySetInnerHTML={{ __html: "<mainText><stats><attention>60</attention> Attack Damage<br><attention>18</attention> Lethality</stats><br><br><passive>Haunt</passive> <br>Gain <speed>40 Move Speed</speed> while out of combat.<br><br><active>ACTIVE</active> (0s)<br><active>Wraith Step</active><br>Gain <speed>Move Speed</speed> and <keyword>Ghosting</keyword>." }} />

        {/* Additional content related to playerData */}
      </>
    ) : (
      // Render alternative content when playerData is not available
      <p></p>
    )}
  </div>
);

export default Dashboard;
